import React from 'react;'
import './brand.css';
import { google, dropbox, altassian, shopify, slack } from './impt.js';
const Brand = () => {
    return (
        <div className="gpt3__padding  section__padding">
            <div>
                <img src={google} alt="google" />
            </div>
        </div>
    )
}

export default Brand
